import React from 'react';
import { Button } from 'antd';
import { withRouter, Router, NextRouter } from 'next/router';

interface HomeProps {
    router: NextRouter;
    url: Router;
}


const Home: React.FC<HomeProps> = (props) => {

    if (window) {
        console.log(props);
    }

    return (
        <Button>{props.router.query.id}</Button>
    )
}


export default withRouter(Home);
